import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class CartService {
  cartProducts:any=[]

  constructor() { }

  getCartProducts(){
    return this.cartProducts;
  }

  add(item:any){
    this.cartProducts.push(item)
  }

}
